import React from 'react';
import Form from '../FormComponent/FormComponent';
import signUpImage from '../../assets/Mobi'

const field_list = [
    { 'label': 'Full name' },
    { 'label': 'Email' },
    {'label': 'Password'},
    {'label': 'Confirm password'},
    {'label': 'mobile number'},
    {'label': 'Gender'}
];

const SignupComponent = () => {
    return ( <>
        <div style={{ 'paddingLeft': '2%' }}>
            <Form fields={field_list} heading="Create an Account" buton='Sign Up' image='doctor.png' />
        </div>
    </> );
}

export default SignupComponent;
